import Swal from 'sweetalert2'
;(function (Scratch2) {
  const LocalAppIconUrl = 'data:image/svg+xml;base64,'
  const LocalAppPictureUrl = 'data:image/svg+xml;base64,'
  if (Scratch2.extensions.unsandboxed === false) {
    throw new Error('Sandboxed mode is not supported')
  }
  Scratch2.translate.setup({
    'zh-cn': {
      'LocalApp.name': '啸天犬的链接本地应用',
      'LocalApp.openCustomApp': '通过协议[p]调起本地应用并传参[v]',
      'LocalApp.startCcwL': '在 共创世界启动器 内打开作品',
      'LocalApp.dCcwL': '下载共创世界启动器',
      'LocalApp.onlyLocalApp': '只允许调起本地应用，禁止当前使用的网络协议',
      'LocalApp.none': '协议不能为空',
      'LocalApp.error': '注意',
      'LocalApp.extNo': '拓展工程不支持使用共创世界启动器！',
      'LocalApp.devI10n': '[CCW启动器开发者]白猫 @ CCW'
    },
    en: {
      'LocalApp.name': "Skydog's Link Local App",
      'LocalApp.openCustomApp':
        'Open custom app with protocol [p] and pass arguments [v]',
      'LocalApp.startCcwL': 'Open the project in the CCW Launcher',
      'LocalApp.dCcwL': 'Download the CCW Launcher',
      'LocalApp.onlyLocalApp':
        'Only allow to open local app, disallow current network protocol',
      'LocalApp.none': 'Protocol cannot be empty',
      'LocalApp.error': 'Note',
      'LocalApp.extNo': 'Extension does not support using CCW Launcher!',
      'LocalApp.devI10n': '[CCW Launcher Developer]白猫 @ CCW'
    }
  })
  function i10n(id) {
    return Scratch2.translate({ id, default: id, description: id })
  }
  class LocalApp {
    runtime
    constructor(runtime) {
      this.runtime = runtime
    }
    getInfo() {
      return {
        id: 'LocalApp',
        name: i10n('LocalApp.name'),
        color1: '#f39a26',
        color2: '#f39a26',
        blockIconURI: LocalAppIconUrl,
        menuIconURI: LocalAppIconUrl,
        blocks: [
          {
            blockType: Scratch2.BlockType.COMMAND,
            opcode: 'openCustomApp',
            text: i10n('LocalApp.openCustomApp'),
            arguments: {
              p: {
                type: Scratch2.ArgumentType.STRING,
                defaultValue: 'ccwl'
              },
              v: {
                type: Scratch2.ArgumentType.STRING,
                // 默认值为start加上extension/或者project/后面和问号前面的那部分
                defaultValue: 'start:654f00c38c40f06e256a81e9'
              }
            }
          },
          {
            blockType: Scratch2.BlockType.COMMAND,
            opcode: 'startCcwL',
            text: i10n('LocalApp.startCcwL')
          },
          {
            blockType: Scratch2.BlockType.COMMAND,
            opcode: 'dCcwL',
            text: i10n('LocalApp.dCcwL')
          }
        ]
      }
    }
    //LocalAppension's code here
    openCustomApp(args) {
      const xy = args.p
      const data = args.v
      // * 几乎所有 __可在网上查找__ 网络协议都在黑名单内
      const blackurl = [
        'HTTP',
        'HTTPS',
        'FTP',
        'SFTP',
        'SMTP',
        'IMAP',
        'POP3',
        'MTP',
        'RTSP',
        'RTP',
        'RTMP',
        'RTCP',
        'RTP-over-UDP',
        'RTP-over-TCP',
        'SIP',
        'SIPS',
        'XMPP',
        'IM',
        'SMS',
        'SKYPE',
        'VOIP',
        'WEBSOCKET',
        'WIF',
        'BIF',
        'NFC',
        'MODEM',
        'DOCX',
        'XLSX',
        'PPTX',
        'ODF',
        'OBSOLETE'
      ]
      // 判断xy是否包含在blackurl列表中 或者 xy包含'//'
      if ( blackurl.includes(xy.toUpperCase()) || xy.includes('//')) {
        Swal.fire({
          title: i10n('LocalApp.error'),
          text: i10n('LocalApp.onlyLocalApp'),
          icon: 'error'
        })
      } else {
        if (xy === '') {
          Swal.fire({
            title: i10n('LocalApp.error'),
            text: i10n('LocalApp.none'),
            icon: 'error'
          })
        } else {
          window.open(xy + '://' + data)
        }
      }
    }
    startCcwL() {
      if (window.location.href) {
        if (
          window.location.href.split('gandi/')[1].split('/')[0] === 'extension'
        ) {
          Swal.fire({
            title: i10n('LocalApp.error'),
            text: i10n('LocalApp.extNo'),
            icon: 'error'
          })
        } else {
          const goLink =
            'ccwl://start:' + window.location.href.split('gandi/')[1]
          const a = document.createElement('a')
          a.href = goLink
          a.target = '_blank'
          a.click()
          a.remove()
        }
      }
    }
    dCcwL() {
      const a = document.createElement('a')
      a.href = 'https://witcat.sipc.plus/CCWLaunchersetup.exe'
      a.target = '_blank'
      a.click()
      a.remove()
    }
  }
  window.tempExt = {
    Extension: LocalApp,
    info: {
      name: 'LocalApp.name',
      description: 'LocalApp.descp',
      extensionId: 'LocalApp',
      iconURL: LocalAppPictureUrl,
      insetIconURL: LocalAppIconUrl,
      featured: true,
      disabled: false,
      collaboratorList: [
        {
          collaborator: '多bug的啸天犬 @ CCW',
          collaboratorURL:
          'https://ccw.site/student/197354885',
        },
        {
          collaborator: i10n('LocalApp.devI10n'),
          collaboratorURL:
          'https://www.ccw.site/student/6173f57f48cf8f4796fc860e',
        }
      ]

      
    },
    l10n: {
      'zh-cn': {
        'LocalApp.name': '啸天犬的链接本地应用',
        'LocalApp.descp': '直接与本地应用交互！共创世界启动器预设！'
      },
      en: {
        'LocalApp.name': "Skydog's Link Local App",
        'LocalApp.descp': 'Link local app directly! CCW Launcher preset!'
      }
    }
  }
})(Scratch)
